pragma solidity ^0.4.11;

import './external-lib/Owned.sol';
import './SetToken.sol';

/**
 * @title {Set} Registry
 * @author Felix Feng
 * @dev Implementation of the {Set} registry.
 */
contract SetRegistry is Owned {
	struct SetMetadata {
	  address set;
	  string name;
	  string symbol;
	  address[] tokens;
	  uint[] units;
  }

	mapping (address => SetMetadata) public sets;

	address[] public setAddresses;
  function getSetAddresses() public constant returns(address[]) { return setAddresses; }
	function setCount() public constant returns(uint length) { return setAddresses.length; }

	mapping (string => address) setBySymbol;
  function getSetAddressBySymbol(string symbol)
    public
    constant
    returns(address setAddress) 
  {
    return setBySymbol[symbol];
  }

  mapping (string => address) setByName;
  function getSetAddressByName(string name)
    public
    constant
    returns(address setAddress) 
  {
    return setByName[name];
  }

	event SetTokenCreated(
    address indexed sender,
    address indexed setAddress,
    address[] tokens,
    uint[] units,
    string name,
    string symbol
  );

  event SetTokenRemoved(
    address indexed sender,
    address indexed setAddress,
    address[] tokens,
    uint[] units,
    string name,
    string symbol
  );

  modifier nameDoesNotExist(string _name) {
    require(setByName[_name] == address(0));
    _;
  }

  modifier symbolDoesNotExist(string _symbol) {
    require(setBySymbol[_symbol] == address(0));
    _;
  }

  /**
   * @dev Constructor Function for the {Set} registry
   */  
	function SetRegistry() {}

	/**
   * @dev Function creates a new {Set} and add to registry
   */  
	function create(address[] _tokens, uint[] _units, string _name, string _symbol)
	  public
	  nameDoesNotExist(_name)
	  symbolDoesNotExist(_symbol)
	  returns(address newSetTokenAddress) 
  {
	  // Instantiate that contract with correct input parameters
	  SetToken newSetToken = new SetToken(_tokens, _units, _name, _symbol);

	  // Add to the list of set addresses
	 	setAddresses.push(address(newSetToken));

	 	// Add to the mapping of set metadata
	 	sets[address(newSetToken)] = SetMetadata({
	 		set: address(newSetToken),
	 		tokens: _tokens,
	 		units: _units,
	 		name: _name,
	 		symbol: _symbol
 		});

	  // Mark name as used by set
	  setByName[_name] = address(newSetToken);

	  // Mark symbol as used by set
	  setBySymbol[_symbol] = address(newSetToken);

	  // Log contract creation
	  SetTokenCreated(msg.sender, newSetToken, _tokens, _units, _name, _symbol);

	  return newSetToken;
	}

	/**
   * @dev Function remove a {Set} from the registry
   */  
	function remove(address _set, uint _setAddressIndex)
		public
		fromOwner
		returns(bool success)
	{
		require(_set == setAddresses[_setAddressIndex]);

		SetMetadata storage set = sets[_set];

    SetTokenRemoved(
      msg.sender,
      _set,
      set.tokens,
      set.units,
      set.name,
      set.symbol
    );

		// Unmark symbol as used
		delete setByName[set.name];

		// Unmark name as used
		delete setBySymbol[set.symbol];

    // Remove from metadata
    delete sets[_set];

		// Remove from array of set addresses
		setAddresses[_setAddressIndex] = setAddresses[setAddresses.length - 1];
		setAddresses.length -= 1;

		return true;
	}

	/**
   * @dev Gets a list of set metadata using a set address
   */  
	function getSetMetadata(address _set) 
		public
		constant
		returns(
		  address, // set address
		  string, // name;
		  string, // symbol;
		  address[], // component tokens;
		  uint[] // component units;			
		) 
	{
		SetMetadata memory set = sets[_set];
		return (
			set.set,
			set.name,
			set.symbol,
			set.tokens,
			set.units
		);
	}
}

